@AktienEugen: Dann hast du die Entwicklung von Heidelberger Druck nicht sehr gut verfolgt im letzten Jahr!
Heidelberger Druck ist längst weg vom reinen Druckmaschinenhersteller, sondern ist jetzt in den Zukunftsbranchen Digitalisierung und Industrie 4.0 (neben dem klassischen Druckgeschäft) tätig.
Aber wenn du shorten willst, nur zu: Am einfachsten geht das über CFDs (dort bin ich Long)! Ich wünsche dir viel Glück, denn das wirst du brauchen! ;-)
